import React, { Component } from 'react'
import styles from '../../ProfileBlocks.module.css';
import { Container, Row } from 'react-bootstrap';
import ProfileCardTeacher from '../ProfileCardTeacher/ProfileCardTeacher';
import RequestsCard from '../RequestsCard/RequestsCard'; 
import TeacherDocumentsCard from '../TeacherDocumentsCard/TeacherDocumentsCard'; 
import ThemesCard from '../../ThemesCard/ThemesCard';

export default class ProfileBlocksTeacher extends Component {
    
  render() {
    const teacherData = {
        name: 'Раевич Ксения Владиславовна',
        type_of_user: 'teacher',
        phone_number: '89029479572',
        email: 'Kshatrova@sfu-kras.ru',
        job_title: 'доцент кафедры СИИ',
        academic_title: 'кандидат технических наук' ,
        academic_degree: 'доцент',
        place_of_work: 'кафедра СИИ',
        number_of_vacancies: 5,
     
    };
    const requestsdata = {
        name: 'Едунова Мария Алексеевна',
        group: 'КИ20-12Б',
        rating: '4,97',
        topic: 'Разработка клиентской части системы автоматизации процессов ГИА',
        type: 'комплексная',
        additional: 'Общая тема комплексной ВКР: Разработка системы автоматизации процессов ГИА.Второй участник комплексной ВКР Замыслова Светлана',
    };

    const tableData = [
      {
        theme: "Распознавание текста на дореформенных отчетах Енисейской губернии XIX века",
        organization: { name: "-", responsible: "-", position: "-", additional: "-" },
        occupied: "да",
        actions: [{ type: "edit", src: "/img/edit.png" }, { type: "delete", src: "/img/delete.png" }]
      },
      {
        theme: "Разработка автоматизированной системы работы шлагбаума ИКИТ",
        organization: { name: "апролве", responsible: "еооео", position: "кекне", additional: "цкцкц" },
        occupied: "нет",
        actions: [{ type: "edit", src: "/img/edit.png" }, { type: "delete", src: "/img/delete.png" }]
      },
    ];
    

    return (
    <Container>
      <Row className="p-4">
      <div class={styles.left_column}>

       <ProfileCardTeacher teacherData={teacherData}/>
        </div>
        <div class={styles.right_column}>
            <RequestsCard requestsdata={requestsdata}/>
        <TeacherDocumentsCard/>
        <ThemesCard/>
        </div>
      </Row>
      </Container>
    )
  }
}
